import { useContext, useState } from "react";
import { Context } from "./Context";

function UserLogin() {

    const [user, setUser] = useState("Guest");
    const openForm = useContext(Context);

    const setOpenForm = () => {
        <Context.Provider value={true}></Context.Provider>
        console.log(openForm);
    }

    return (
        <>
            <div className="sidenavlogin">
                <p>Hi {user}!</p>
                <p>Welcome to Access Workspace</p>
                <p><button onClick={() => setOpenForm}>Login</button></p>
            </div>
        </>
    );
}

export default UserLogin;
